import React from "react";
import man from "../images/man.png";

const Main = () => {
  return (
    <div className="main">
      <section className="hero">
        <h1 className="main-text" style={{ color: "white" }}>
          Hello!
        </h1>
        <img className="main-img" src={man} alt="Logo" />
      </section>
    </div>
  );
};

export default Main;
